import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="./logo-naluri.svg" alt="Naluri" title="Naluri" width="300" class="mb-5"/>
        <h2>Space project</h2>
        <p class="mb-0">Current known value of Pi: </p>
        <p class="mb-0">Circumference of the sun: </p>
      </header>
    </div>
  );
}

export default App;
